<style>
    body {
        background-color: #f0f0f0;
    }

    h1 {
        font-family: 'Open Sans', sans-serif;
        color: #3b3b3b;
        font-size: 1.5em;
    }

    a.btn {
        display: inline-block;
        position: relative;
        color: #3b3b3b;
        font-family: 'Open Sans', sans-serif;
        letter-spacing: 0.05rem;
        font-size: 1em;
        line-height: 1.675;
        border: 1px solid;
        padding: 10px 15px;
        margin-top: 10%;
        text-decoration: none;
    }

    .center {
        /*Fix for chrome issue for text transform blur*/
        -webkit-filter: blur(0.000001px);
        text-align: center;
        position: absolute;
        top: 40%;
        left: 50%;
        transform: translate(-50%, -50%);
    }

    .imageContainer {
        position: relative;
        display: block;
        width: 200px;
        height: 200px;
    }

    .outer {
        position: absolute;
        left: 50%;
        margin: 0 0 0 -100px;
        animation: spinclock 8s infinite linear;
    }

    .inner {
        position: absolute;
        left: 50%;
        margin: 0 0 0 -100px;
        animation: spincounter 10s infinite linear
    }

    @keyframes spinclock {
        from {
            transform: rotate(0deg);
        }
        to {
            transform: rotate(360deg);
        }
    }

    @keyframes spincounter {
        from {
            transform: rotate(0deg);
        }
        to {
            transform: rotate(-360deg);
        }
    }

</style>
